import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import AdminDashboard from './admin/AdminDashboard';
import DoctorDashboard from './doctor/DoctorDashboard';
import PatientDashboard from './patient/PatientDashboard';
import MyDossiers from './components/MyDossiers'; 
import PrivateRoute from './auth/PrivateRoute';
import MesPatients from './pages/doctor/MesPatients.js';
import MesDossiers from './pages/doctor/MesDossiers.js';
import DossierDetail from './pages/doctor/DossierDetail.js';
import CreerDossier from './pages/doctor/CreerDossier.js';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Admin (prot√©g√©) */}
          <Route
            path="/admin"
            element={
              <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
                <AdminDashboard />
              </PrivateRoute>
            }
          />

          {/* üöÄ M√âDECIN - CORRIG√â */}
          <Route
            path="/medecin"
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <div className="p-6">
                  {/* Index redirige vers patients */}
                  <Routes>
                    <Route index element={<Navigate to="/medecin/patients" replace />} />
                    <Route path="patients" element={<MesPatients />} />
                    <Route path="dossiers" element={<MesDossiers />} />
                    <Route path="dossier/:id" element={<DossierDetail />} />
                    <Route path="creer-dossier/:patientId?" element={<CreerDossier />} />
                  </Routes>
                </div>
              </PrivateRoute>
            }
          />

          {/* Mes Dossiers (prot√©g√© pour les patients) */}
          <Route
            path="/mes-dossiers"
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <MyDossiers />
              </PrivateRoute>
            }
          />

          {/* Redirection par d√©faut */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
